import { Button } from "antd";
import React from "react";
import { BsBookFill,BsCollectionPlayFill } from "react-icons/bs";

export default function Story() {
  return (
    <div style={{ backgroundColor: "white" }}>
      <div style={{ display: "flex", width: "100%" }}>
        <span
          style={{
            display: "flex",
            width: "100%",
            justifyContent: "center",
            borderBottom: "1px solid blue",
          }}
        >
          <Button style={{ display: "flex", alignItems: "center", justifyContent: 'center', width: '100%', fontSize: 20 }} type="text">
            <BsBookFill style={{marginRight: 10}} />
            Tin
          </Button>
        </span>
        <span
          style={{ display: "flex", width: "100%", justifyContent: "center" }}
        >
          <Button style={{ display: "flex", alignItems: "center" }} type="text">
            <BsCollectionPlayFill />
            Reels
          </Button>
        </span>
      </div>
    </div>
  );
}
